import React from "react";
import AdmProductGrid from "../components/AdmProductGrid";

const PageAdmProducts = () => {
  const columns = React.useMemo(
    () => [
      {
        Header: "Name",
        columns: [
          {
            Header: "First Name",
            accessor: "firstName",
          },
          {
            Header: "Last Name",
            accessor: "lastName",
          },
        ],
      },
      {
        Header: "Info",
        columns: [
          {
            Header: "Age",
            accessor: "age",
          },
          {
            Header: "Visits",
            accessor: "visits",
          },
          {
            Header: "Status",
            accessor: "status",
          },
          {
            Header: "Profile Progress",
            accessor: "progress",
          },
        ],
      },
    ],
    []
  );

  useEffect(() => {
    (async () => {
      const response = await fetch("http://localhost:8000/api/products");
      const data = await response.json();
      setResults(data);
    })();
  }, []);

  return (
    <div className="container" id="CatalogPage">
      <div className="row">
        <div className="col-lg-12 col-md-12">
          <div className="section-title">
            <h4>Administrar Productos</h4>
          </div>
        </div>
      </div>
      <div className="row">
        <AdmProductGrid
          columns={columns}
          queryData={data}
          updateMyData={updateMyData}
          skipPageReset={skipPageReset}
        />
      </div>
    </div>
  );
};

export default PageAdmProducts;
